import TypeWriter from "typewriter-effect";
import "./Home.css";

const Home = () => {
  return (
    <div className="home">
      <h1>Welcome fellow Jovo!</h1>
      <p>Random inspiration quote for you</p>
      <TypeWriter
        style={{ width: "50%" }}
        options={{
          loop: true,
          wrapperClassName: "typewriter"
        }}
        onInit={(typewriter) => {
          typewriter
            .typeString('The most damaging phrase in the language is "It\'s always been done this way"')
            .start();
        }}
      />
    </div>
  );
};

export default Home;
